import { StyledNav } from './styles/Nav.styled';

const Nav = () => {
  return (
    <StyledNav>
      <div className="left">
        <img
          src="https://upload.wikimedia.org/wikipedia/commons/thumb/0/08/Netflix_2015_logo.svg/2560px-Netflix_2015_logo.svg.png"
          alt="netflix-logo"
        />
      </div>
      <div className="right"></div>
    </StyledNav>
  );
};

export default Nav;
